text:
@letstweet921 @whartonswords What I’m reading here, is verbal abuse is ok? Not buying that. 
We clearly aren’t going to agree. 
What’s dreadfully sad is seeing this being replayed as some sort of entertainment, and seeing someone have to relive all that they went through.

@bushontheradio During the height of the pandemic when I was driving home from a particularly rough ICU shift. 
Nothing could have prepared me for the absolute raw grief I felt that day. I cried all the way home. 
Seeing people on social media criticising my colleagues and me. That was hard
